import logo from './logo.svg';
import './App.css';
import googleLogin from 'react-google-login'
import { useEffect } from 'react';
import { gapi } from 'gapi-script';

const CLIENT_ID = "501816916441-50t2r4ud6jsla2bu3a4ggtdg8vbumocm.apps.googleusercontent.com";
const SCOPES = 'profile email https://www.googleapis.com/auth/calendar.readonly' //change to edit scopes of google permissions

function App() {

  useEffect(() => {
    function start() {
      gapi.client.init({
        clientId: CLIENT_ID, 
        cookie_policy: 'none',
        scope: SCOPES
      })
    };
    gapi.load('client:auth2', start);
  });

  return (
    <div className="App">
     <Login/>
     <Logout/>
    </div>
  );
}

export default App;
